import IStrategy from "../../interface/IConcreteStrategy";
import Unit from "../unit/Unit";
export default class HexerStrategy implements IStrategy {
  public doAlgorithm(position: number): void {
    console.log("Hexer strategy", position);
  }
  public doTargetSelection(unit: Unit): Array<Unit> {
    console.log(" Hexer target selection");
    console.log(unit);
    console.log("unit in queue");
    const units = [unit, unit];
    return units;
}
}
